Manuel del Palacio (1831-1906) fue un poeta, periodista y satírico español del Realismo. Fue conocido por sus sonetos y poemas de carácter humorístico y satírico, aunque también escribió poesía seria. Este soneto, "Trabajo perdido", es una de sus obras más conocidas.
